-- Table: Proyecto
DROP TABLE IF EXISTS Proyecto;

CREATE TABLE Proyecto (
    ID_Proyecto              INTEGER      NOT NULL,
    Fecha_Inicio             DATETIME     NOT NULL,
    Constructora             VARCHAR (45) NOT NULL,
    Numero_Banos             REAL         NOT NULL,
    Numero_Habitaciones      REAL         NOT NULL,
    Banco_Vinculado          VARCHAR (45) NOT NULL,
    Porcentaje_Cuota_Inicial REAL         NOT NULL,
    Ciudad                   VARCHAR (45) NOT NULL,
    Clasificacion            VARCHAR (45) NOT NULL,
    Acabados                 VARCHAR (45) NOT NULL,
    Serial                   VARCHAR (12) NOT NULL,
    ID_Tipo                  INTEGER      NOT NULL,
    ID_Lider                 INTEGER      NOT NULL,
    FOREIGN KEY (
        ID_Tipo
    )
    REFERENCES Tipo (ID_Tipo),
    FOREIGN KEY (
        ID_Lider
    )
    REFERENCES Lider (ID_Lider),
    PRIMARY KEY (
        ID_Proyecto
    )
);

